import React from "react";
import spinner from "../public/spinner.gif";

const Spinner = () => {
  return (
    <div>
      <img
        src={require(spinner)}
        alt="Loading..."
        style={{ width: "200px", margin: " 40px auto", display: "block" }}
      />
    </div>
  );
};

export default Spinner;
